import React from 'react';
import Jumbotron from 'react-bootstrap/Jumbotron';


export default function Header(props) {

    return (
        <Jumbotron className="bg-dark text-light">
            <h1>{props.title}</h1>
            <h3>{props.subtitle}</h3>
            <p>{props.description}</p>
        </Jumbotron>
    );
}
